import React from 'react'
import {Link} from 'react-router-dom'

const DogList = ({dogs}) => {
    console.log(dogs)
    return(
    <>
        <h1>Dog List</h1>
        {dogs.map(dog => 
        <img src={`/public/${dog.name}`} alt='image of dog'></img>
        )}
    </>
    )
}

export default DogList;
